  componentDidMount() {
    const options = {
      stringsElement: '#ExpCollection',
      typeSpeed: 50,
      backSpeed: 25,
      backDelay: 1000,
      loop: true,
      showCursor: false
    }

    this.typed = new Typed(this.el, options);
  }

  componentWillUnmount() {
    this.typed.destroy();
  }

  render() {
    return (
      <div className="ExperiencePage">
        <section className="Experience-sect">
